import React from 'react';
import Grid from '@mui/material/Grid';
import {Box, Container} from '@mui/material';
import ResponsiveAppBar from './appBar/navbar'
import SignIn_form from './signIn_form/signIn'

const Home = () => {
    return (
        <Container maxWidth="xl" sx={{ pt: '10px' }}>
        <Box sx={{border : '2px solid black' , width: '100%', mx: 'auto' ,flexGrow: 1 }}>
            <Grid container spacing={1}>
                <Grid sx={{border : '2px solid black' , width: '80%'}}  xs={12} md={12}>
                    <ResponsiveAppBar />
                </Grid>
                <Grid xs={12} md={12}>
                    <SignIn_form />
                </Grid>
            </Grid>
        </Box>
        </Container>

    );
}

export default Home;
